          {/* Replace this with actual ticket display logic */}
        </Grid>
      </>
    ) : (
      // Default placeholder content
      <>
      </>
    )}
  </Grid>

        {/**
          <Grid container spacing={1}>
            <Grid size={5} />
            <Grid size={12}>
              <Skeleton height={14} />
